// 공지사항 데이터 5개 저장
exports.Send_Notice_Five_Data = function (socket, cur_num) {
  return new Promise((resolve, reject) => {
    socket.emit("Send Notice Five Data Save", {
      cur_num: cur_num,
    });
    resolve(0);
  });
};
exports.Rec_Notice_Five_Data = function (socket) {
  return new Promise((resolve, reject) => {
    socket.on("Receive Notice Five Data Save", (message) => {
      resolve(message);
    });
  });
};

// 불만사항 데이터 5개 저장
exports.Send_Complaint_Five_Data = function (socket, cur_num) {
  return new Promise((resolve, reject) => {
    socket.emit("Send Complaint Five Data Save", {
      cur_num: cur_num,
    });
    resolve(0);
  });
};
exports.Rec_Complaint_Five_Data = function (socket) {
  return new Promise((resolve, reject) => {
    socket.on("Receive Complaint Five Data Save", (message) => {
      console.log("message");
      console.log(message);
      resolve(message);
    });
  });
};
